import { BrowserRouter , Route, Routes } from "react-router-dom";
import TopicQuiz from './screens/TopicQuiz/TopicQuiz'

function App() {
  return (
    <BrowserRouter>

<Header/>
<main>
  <Routes>
  <Route path='/' Component={LandingPage} exact/>
\
  <Route path='/topicQuiz' Component={TopicQuiz} />
  </Routes>
</main>
<Footer />
    </BrowserRouter>
  );
}

export default App;
